import React from "react";
import '../css/GLOBAL_STYLES.css'
import '../css/normalize.css';
import '../css/style.css';

const GetUsersItem = (props) => {
    return <div className="user_item flex" userid={props.id}>
        <div className="user_item_info flex">
            <div className="item_info_userId"><mark>id: </mark>{props.id}</div>
            <div className="item_info_userId"><mark>name: </mark>{props.name}</div>
            <div className="item_info_userId"><mark>email: </mark>{props.email}</div>
            <div className="item_info_userId"><mark>phone: </mark>{props.phone}</div>
            <div className="item_info_userId"><mark>password: </mark>{props.password}</div>
        </div>
        <div className="user_item_buttons flex">
            <button className="user_item_btn">Редактировать</button>
            <button className="user_item_btn user_item_delete_btn">Удалить</button>
        </div>
    </div>;
}

export default GetUsersItem;
